import React from 'react';
import { Link } from 'react-router-dom';
//import logo from './src/imgs/logo.png';
import "./Header.css";
import Button from '@material-ui/core/Button';

function Header() {
    return (
        <div className="header">
            <div className="header__left" >
                <img src={process.env.PUBLIC_URL + '/logo.png'} alt="logo"/>
            </div>
            <div className="header__middle">
                <ul className='ul-header' >
                    <li id="menu-item-1"className="menu-item menu-item-type-post_type menu-item-object-page menu-item-has-children menu-item-1 has-submenu active_submenu">
                        <a href="">Services</a>
                    </li>
                    <li id="menu-item-2"className="menu-item menu-item-type-post_type menu-item-object-page menu-item-has-children menu-item-2 has-submenu active_submenu">
                        <a href="">Blog</a>
                    </li>
                    <li id="menu-item-3"className="menu-item ">
                        <a href="">About</a>
                    </li>
                </ul>

            </div>
            <div className="header__right">
            <Button variant="contained" color="primary">Get Started</Button> 
            </div>
        </div>
    )
}

export default Header
